import react from "react";

export default function Login() {
  return (
    <div className="login-body">
      <div className="login-div">
          <h1>Login</h1>
        <input
          type="text"
          className="input-primary"
          placeholder="Username "
        />
      
      </div>
    </div>
  );
}
